import React,{useEffect, useState} from 'react'
import "./style.css"

const News = () => {
    const [user, setUser] = useState([]);
    const [page, setPage] = useState

    const getUser = async () => {
      const response = await fetch("https://jsonplaceholder.typicode.com/posts");
      setUser(await response.json());
    };
  
    useEffect(() => {
      getUser();
    }, []);
    return (
        <>
        <div className="news-div">
            {
        user.map((curEle) => { 
        return (

                <div className="news-c-div" key={curEle.id}>
                <div className="img-div"><img src="\images\close.svg" alt="" /></div> 
                 <h1>{curEle.title}</h1>
                 <p>{curEle.body}</p>
                 </div>
        )
                 
        })
    }

                 </div>
        </>
    )
}


export default News;
